package main

import (
	"encoding/json"
	"fmt"

	"github.com/morsby/billedvaeg"
)

func main() {

	positionsJson := `[{"title":"Ledende overlæge", "abbr": "LO", "value": 1}, {"title":"Reservelæge", "abbr": "R", "value": 2}]`

	var positions []*billedvaeg.Position
	err := json.Unmarshal([]byte(positionsJson), &positions)
	if err != nil {
		panic(err)
	}
	for _, p := range positions {
		fmt.Println(p)
	}

	pplJson := `[{"name": "Sigurd", "position": 1, "suppl": "UKYL", "img": "` + img + `"}]`
	var ppl []*billedvaeg.Person
	err = json.Unmarshal([]byte(pplJson), &ppl)
	if err != nil {
		panic(err)
	}

	doc := billedvaeg.New()
	doc.Positions = positions
	doc.People = ppl

	err = doc.Generate(true)
	if err != nil {
		fmt.Println(err)
	}
	doc.PDF.OutputFileAndClose("test.pdf")
}

const img string = ``
